INSERT INTO `pages` VALUES (3,'Privacy','<p><strong>This Policy defines the scope of privacy and degree of confidentiality protecting the information provided by users during registration and normal use of Svanty.com (&ldquo;Site&rdquo;), Svanty&rsquo; services, programs and facilities. At any time, users can, at their discretion, allow or forbid collection and use of their personal information.</strong></p>\r\n\r\n<p><strong>This Policy applies to Site owned and operated by Svanty (Ukraine). By using the Site, user provides his/her consent that Svanty has the authority to collect, use and disclose the user&rsquo;s personal information according to the rules of this Policy.</strong></p>\r\n\r\n<p><strong>Svanty proclaims and accepts its responsibility to protect the user&rsquo;s personal information. This document contains the rules upon which such information is collected and used, and also the reasons for disclosure of such information. These rules apply to any personal information collected by Svanty.</strong></p>\r\n\r\n<p>1. COLLECTION OF INFORMATION</p>\r\n\r\n<p>During work with the Site, technical non-personal information about the user such as the user&rsquo;s IP address, address of another site the user came to the Site from, time of the visit, and browser type and language version, may be collected automatically. We may also collect and analyze navigational information, namely the address and path of the user through the Site, actions performed at the Site, jumps to and from inner links, etc.</p>\r\n\r\n<p>Personal information of the User is collected only upon prior permission from the User to collect and use certain information within these rules. Giving such permission, the User supplies such information voluntarily.</p>\r\n\r\n<p><strong>&quot;Personal information&quot; includes:</strong></p>\r\n\r\n<ul>\r\n	<li>\r\n	<p>Information supplied by the user during registration at the Site, including the login, full name and e-mail. When user registers as a Contributor on the Site, Svanty collects additional information such as postal address and contact phone number;</p>\r\n	</li>\r\n	<li>\r\n	<p>Information supplied by the User during purchase, such as a billing address and the credit card number;</p>\r\n	</li>\r\n	<li>\r\n	<p>If the user is registered as a Contributor, information provided by him/her for payments, including data about the account in a financial institution used for the payments, and also information supplied by the user for personal identification (copy of the passport, driver&rsquo;s license or another personal identification document).</p>\r\n	</li>\r\n	<li>\r\n	<p>Registered users also have an option to provide additional personal information such as address and phone number within their profiles. Each user can control what information is displayed publicly at &ldquo;Edit profile&rdquo; page.</p>\r\n	</li>\r\n</ul>\r\n\r\n<p>Svanty never requires users to provide genetic data, biometric data, information revealing racial or ethnic origin of users, their political opinions, religious or philosophical beliefs, trade-union membership, and data concerning their health or sex life or sexual orientation.</p>\r\n\r\n<p>Each user has the right to refuse the submission of personal information at any time. However, in this case, some functions and services offered at the Site may be degraded and/or made unavailable, in part or in its entirety.</p>\r\n\r\n<p>2. USE OF PERSONAL INFORMATION</p>\r\n\r\n<p>Collection and use of the user&rsquo;s personal information is performed by Svanty for the following purposes:</p>\r\n\r\n<ul>\r\n	<li>\r\n	<p>Creation, management and maintenance of an account;</p>\r\n	</li>\r\n	<li>\r\n	<p>Processing of the User&#39;s inquiries and operations at the Site;</p>\r\n	</li>\r\n	<li>\r\n	<p>Customer service;</p>\r\n	</li>\r\n	<li>\r\n	<p>Data analysis and statistical research for the purposes of improving offered goods, products or technologies;</p>\r\n	</li>\r\n	<li>\r\n	<p>Provision and display of the content specially chosen in accordance with preferences and interests of the User;</p>\r\n	</li>\r\n	<li>\r\n	<p>Maintenance of operation of interactive areas;</p>\r\n	</li>\r\n	<li>\r\n	<p>Payment of commission to Contributors;</p>\r\n	</li>\r\n	<li>\r\n	<p>Identification of the supplied files as belonging to a certain Contributor;</p>\r\n	</li>\r\n	<li>\r\n	<p>Realization of communication and contacts on matters concerning transactions made by the User;</p>\r\n	</li>\r\n	<li>\r\n	<p>Notification about new goods and services to the Site User;</p>\r\n	</li>\r\n	<li>\r\n	<p>Marketing communications for promotion and advertising of Svanty&rsquo; and third-party products.</p>\r\n	</li>\r\n</ul>\r\n\r\n<p>Svanty will ask for user&rsquo;s consent before using his/her personal information for a purpose other than listed in this Policy.</p>\r\n\r\n<p>Svanty collects personal information about its users only, and does not require users to provide Svanty with personal information of any third persons, except for case of sharing the lightbox preview as described below.</p>\r\n\r\n<p>Svanty has the ability to send communications concerning transactions performed by the user, payment reminders and questions concerning purchase confirmation.</p>\r\n\r\n<p>Users are free to select one-click opt-out possibility to unsubscribe from promotional and advertising communications. Svanty will not further send promotional and advertising messages once objection is received from a user. This one-click subscription is not available for transactional messages that are generally required. To opt-out of communications connected to transactions, users shall deactivate their accounts.</p>\r\n\r\n<p>Our promotional and advertising messages will always be clearly identified as promotional and/or advertising, and will always contain both return e-mail address and physical postal address of Svanty. This return e-mail address will be capable of receiving user communications for no less than 30 days after the transmission of the original message.</p>\r\n\r\n<p>Personal information collected by Svanty may be processed and stored in other countries at facilities belonging to Svanty and/or legally used by Svanty. Supplying Svanty with the personal information, users permit its transfer outside the country within the bounds of such use, provided that privacy laws other countries where the information Is transferred may not be as protective as those in users&rsquo; jurisdiction.</p>\r\n\r\n<p>3. DISCLOSURE OF PERSONAL INFORMATION</p>\r\n\r\n<p>Except in situations clearly stated within these rules, Svanty does not disclose, sell, lease, lend, rent or make available personal information of the user to any third parties.</p>\r\n\r\n<p>Users&rsquo; personal information can be disclosed and shared with partner agencies that render services on behalf of Svanty. The services may include money transfer, data storage, reselling licenses, payment processing, etc. These third parties will receive only the information required to provide said specific services; the information will be kept and protected by the same principles and level of protection followed by Svanty, and it cannot be used for any other purposes.</p>\r\n\r\n<p>Information about users may also be passed and disclosed as a business asset in the case of acquisition, sale or absorption of the company. In the event of this unlikely case, Svanty will inform users in accordance with the procedure outlined below.</p>\r\n\r\n<p>Svanty reserves the right to disclose and pass personal information of the User if it is required by law and when we believe that disclosure is necessary to protect our rights and/or to comply with a judicial proceeding, court order, or legal process served on our Site.</p>\r\n\r\n<p>4. ACCESS TO OWN PERSONAL INFORMATION</p>\r\n\r\n<p>Information indicated by the User at the Site can be reviewed and edited in the section &laquo;Main Menu &mdash; Profile&raquo;. Alternatively, users may contact Svanty at support@svanty.com and request a copy of information collected by Svanty to be extracted and provided in a readable format. Svanty will respond to such request without unreasonable delay.</p>\r\n\r\n<p>We will retain users&rsquo; information for as long as their accounts are active or as needed to provide services to users.</p>\r\n\r\n<p>Users shall contact us at support@svanty.com in order to cancel his or her account or request that we delete or no longer use their information to provide services. In this case, we will retain and use user&rsquo;s information only to the extent, necessary to comply with our legal obligations, prevention of fraud, resolution of disputes and performance of our agreements.</p>\r\n\r\n<p>5. USE OF COOKIES AND OTHER TECHNOLOGIES</p>\r\n\r\n<p>Svanty and our partners use cookies or similar technologies to analyze trends, administer the website, track users&rsquo; movements around the website, and gather demographic information about our user base as a whole. Users can control the use of cookies at the individual browser level.</p>\r\n\r\n<p>The User can allow or forbid the use and acceptance of cookies on his/her computer. If cookies are blocked by the User, it may prevent the User from being able to register or perform other interactive functions of the Site, but it will not affect the User&rsquo;s ability to perform general navigation within the Site.</p>\r\n\r\n<p>Email information collected for sending light boxes is not stored or used for any other purpose. That information is not shared with any other parties.</p>\r\n\r\n<p>6. PROTECTION OF THE USER&#39;S PERSONAL INFORMATION</p>\r\n\r\n<p>Svanty actively monitors and enforces the information protection standards during all Svanty&#39; activity, namely:</p>\r\n\r\n<ul>\r\n	<li>\r\n	<p>Limitation of the rendered access to information only to those employees who need it for providing services to the User;</p>\r\n	</li>\r\n	<li>\r\n	<p>Signature of confidentiality treaties by employees;</p>\r\n	</li>\r\n	<li>\r\n	<p>Signature by partners and external companies invited for fulfillment of particular functions of confidentiality treaties and agreements concerning non-use of such information for any unauthorized purposes;</p>\r\n	</li>\r\n	<li>\r\n	<p>Encryption of payment data such as credit card number using SSL technology through the use of our third-party payment gateway service providers;</p>\r\n	</li>\r\n	<li>\r\n	<p>Storing of the personal information obtained from the User in encrypted form, at protected computers secured from unauthorized access.</p>\r\n	</li>\r\n</ul>\r\n\r\n<p>Since there is no perfect secure method of protecting information during its storage, processing and transfer into electronic form, Svanty does not give the full warranty of its complete safety, despite all efforts made by the company. If information of an account and personal data of the User are protected with a password, safety and nondisclosure of this password are responsibility of the User him/herself.</p>\r\n\r\n<p>Users also have a right to lodge a complaint with competent supervisory authorities in countries of their residence or location should users consider that any of their privacy rights may be infringed by Svanty.</p>\r\n\r\n<p>7. SENDING A LIGHTBOX</p>\r\n\r\n<p>If you choose to use our referral service to send a friend a preview of a lightbox, we will ask you for your friend&rsquo;s email address. We will automatically send your friend a one-time email inviting him or her to visit the Site and view the lightbox. Svanty does not store this information, it is for the sole purpose of sending this one-time email.</p>\r\n\r\n<p>8. OPEN ID CONTRIBUTOR</p>\r\n\r\n<p>You can log in to our Site using sign-in services such as Facebook Connect or an Open ID contributor. These services will authenticate your identity and provide you the option to share certain personal information with us such as your name and email address to pre-populate our sign- up form. Services like Facebook Connect give you the option to post information about your activities on the Site to your profile page to share with others within your network.</p>\r\n\r\n<p>9. MINOR USERS</p>\r\n\r\n<p>Site, Site content and services are neither intended to be used by minors and persons under age of 18, nor designed and intended to willfully and knowingly collect, use, or disclose any personal information from minors and persons under age of 18. Svanty will immediately remove personal information from children and/or search to obtain a verifiable parental consent for the collection use, or disclosure of personal information from children, once it will come to Svanty&rsquo; attention that any personal information from children was submitted or collected through the Site.</p>\r\n\r\n<p>The User confirms and warrants that he/she has reached the age of 18, has all the sufficient for usage of the Site and is bound by legal obligations sufficient for any liability that can appear as a result of usage of the Site files. The User agrees to bear full responsibility for all cases of the Site usage without distinction, as well as for use of his/her login and password by third parties including minors and persons under age of 18 living with him/her.</p>\r\n\r\n<p>10. LINKS</p>\r\n\r\n<p>The Site pages can contain links to sites, services and functions of third parties, subsidiaries and affiliates that may use and conform to different rules and procedures of confidentiality provision from those stated here. Svanty is not responsible for the policy of confidentiality of such resources.</p>\r\n\r\n<p>11. BLOGS</p>\r\n\r\n<p>Our Site offers publicly accessible blogs or community forums. You should be aware that any information you provide in these areas may be read, collected, and used by others who access them. To request removal of your personal information from our blog or community forum, contact us at support@svanty.com .</p>\r\n\r\n<p>Our blog is also managed by a third-party application that may require you to register to post a comment. We do not have access or control of the information posted to the blog. You will need to contact or login into the third-party application if you want the personal information that was posted to the comments section removed. To learn how the third-party application uses your information, please review their privacy policy.</p>\r\n\r\n<p>12. SOCIAL MEDIA WIDGETS</p>\r\n\r\n<p>Our Site includes Social Media Features, such as the Facebook Like button, and Widgets, such as the Share This button, or interactive mini-programs that run on our Site. These Features may collect your Internet protocol address, which page(s) you are visiting on our Site, and may set a cookie to enable the Feature to function properly. Social Media Features and Widgets are either hosted by a third party or hosted directly on our Site. Your interactions with these Features are governed by the privacy statement of the company providing it.</p>\r\n\r\n<p>13. CHANGES TO THESE RULES</p>\r\n\r\n<p>We may update this privacy policy to reflect changes to our information practices. If we make any file (or material) changes we will notify you by means of a notice on this Site prior to the change becoming effective. We encourage you to periodically review this page for the latest information on our privacy practices.</p>\r\n\r\n<p>14. CONTACT US</p>\r\n\r\n<p>For any questions, concerns or suggestions regarding our privacy policy, please contact us at support@svanty.com.</p>\r\n\r\n<p>Both users and persons who don&rsquo;t use Svanty services shall be free to contact Svanty with any questions, concerns or suggestions regarding our privacy.</p>\r\n\r\n<p><strong>Disclaimer: </strong>The original, legally binding version of this document is written in English, and it is translated into other languages for the courtesy of our non-English-speaking users. If there are any discrepancies between the English version and a translated version, the English version supersedes the translated version.</p>','privacy');
INSERT INTO `pages` VALUES (5,'About','<p>Hello, it&#39;s nice to see You on our page. We are the modern free stock photo portal and our aim is to provide free content for our customers.&nbsp;</p>\r\n\r\n<p>All ideas and questions you can send to <strong>support@svanty.com</strong></p>','about');
INSERT INTO `pages` VALUES (6,'Terms of Use','<p><strong>This Agreement governs the terms of use for the Svanty Site. Information regarding the rights and licenses on usage of royalty-free files is given in the Standard and Extended License Agreements.</strong></p>\r\n\r\n<p><strong>This Site is owned and operated by Svanty. Depending on your billing address your invoices may be payable to one of the Svanty entities acting as the licensor (i.e. Svanty (Ukraine), Svanty (Poland) etc.). Access to all Site files and functions is given to the User on the condition that he/she accepts and agrees with the Terms of Use of the Site. Use of the Site indicates the User&rsquo;s consent with these Terms. If the User does not agree with the current Terms of Use, he/she should leave the Site.</strong></p>\r\n\r\n<p><strong>Svanty retains the right to revise and change the Terms of Use at any time without notification of the User. The User agrees that to gain full and updated information on the Terms of Use he/she should periodically review this section. The User&rsquo;s ongoing use of the Site after publication of any possible changes to the current Terms indicates the User&rsquo;s consent with the effective changes.</strong></p>\r\n\r\n<p><strong>The User has no right to interfere in the Site security provision or, in any other similar way, to use the Site or other system resources, networks and services accessible through or connected to the Site in a corrupt manner. The User agrees to use the Site entirely within the lawful and intended limits.</strong></p>\r\n\r\n<p>1. INTELLECTUAL PROPERTY</p>\r\n\r\n<p>All of the Site assets, including the system of organization and presentation of the files at the Site, are the property of Svanty and its shareholders, and are protected by legal and subordinate acts relating to intellectual property including but not limited to copyright laws and other similar laws.</p>\r\n\r\n<p>In case of absence of a separate written agreement with Svanty (such as the Standard License Agreement), unconditioned use of the files offered at the Site without written permission of Svanty is prohibited.</p>\r\n\r\n<p>Files available at the Site may be copied and used for private use by the User solely for non-commercial or educational purposes only. Also, it is forbidden to change the files in any way (for example, to delete or hide copyright marks). The User has no right to create derivative works from the files presented at the Site or use them otherwise.</p>\r\n\r\n<p>2. CONFIDENTIALITY</p>\r\n\r\n<p>Svanty respects the confidentiality of private and personal information of all cooperating parties. For more information about the procedure of collection, use and disclosure of the User&rsquo;s confidential information, refer to the Privacy Policy. The User is advised to become familiar with this document.</p>\r\n\r\n<p>3. SITE UPDATES</p>\r\n\r\n<p>Svanty regularly updates technical, content and other information on the Site. Nevertheless, Svanty makes no claim guaranteeing the completeness, accuracy and compliance of the information given at the Site. Svanty is able to add, review or delete information, resources and services posted on the Site. Also, Svanty reserves the right to make changes to the Site without prior notification.</p>\r\n\r\n<p>4. LINKS TO OTHER SITES</p>\r\n\r\n<p>There may be links to third-party sites on the Site. Such links are given solely for the User&rsquo;s convenience. Their presence does not mean that they are recommended or endorsed by Svanty. Also, Svanty does not warrant their safety and accordance with the User&rsquo;s expectations. Svanty shall not bear any liability in case of any damages or losses, direct or implicit, due to a visitation originating from Svanty, or to the use of services available from third-party sites.</p>\r\n\r\n<p>5. SOFTWARE AND COMPUTER VIRUSES</p>\r\n\r\n<p>At times, site failures may happen due to Internet connection, software operation, data transmission, etc., and it is possible that incorrect or incomplete copy of the information contained at the Site pages may occur. Similarly, the Site pages may contain malicious code or programs infected with computer viruses.</p>\r\n\r\n<p>Svanty is not responsible and bears no liabilities connected to the work of any software, the presence of any computer viruses or other elements with malicious code, the presence of destructive or unsafe files that can be distributed or otherwise affect software and hardware upon the User&rsquo;s review of the Site, the access to any information on the Site, or the downloading of any files from the Site. Svanty strongly encourage the use of anti-virus software or other protective programs during interaction with all web sites.</p>\r\n\r\n<p>6. FILES PRESENTATION FORMAT</p>\r\n\r\n<p>The Site content and the Site itself are provided for review and use without any personal interference from the side of the Site holders (except pre-moderation), conditions and warranties of any kind, expressed or implied. These warranties include conditions and warranties of merchantability. Svanty does not guarantee that the Site content, its work or the Site as a whole will meet the expectations and requirements of the User, nor that the process of its usage will be faultless and without interruption for reason.</p>\r\n\r\n<p>7. LIABILITY LIMITATION</p>\r\n\r\n<p>The User confirms that he/she understands and takes responsibility and assumes all risk resulting from the use of the Site without limitations.</p>\r\n\r\n<p>Svanty and also its employees, management, partners, shareholders, and agents do not bear responsibility for failures of any kind or shutdown of the Site resulting in loss of business information, profit or other financial losses due to claims of any kind, losses, petitions, actions or other events occurring due to validity of these Terms of Use, including without limitations the Site navigation, use, access to any files or their parts, as well as any rights including even in the event Svanty was advised of the theoretical possibility of such damages, irrespective of whether the occurring event and damage were the result of infringement on intellectual or any other property, based on a breach of law, negligence, contract liabilities or other similar cases and situations, or not.</p>\r\n\r\n<p>Total aggregate liability of Svanty in connection with the use of the Site, in whole or in part, or its content in money equivalent shall not exceed ten US dollars ($10.00).</p>\r\n\r\n<p>8. INDEMNIFICATION</p>\r\n\r\n<p>Consenting to the terms of this Agreement, the User agrees to indemnify, defend and hold Svanty, its affiliates, its Content contibutors and their respective directors, officers, employees, shareholders, partners and agents (collectively, the &quot;Svanty parties&quot;) harmless from and against all claims, liability, losses, damages, costs and expenses (including reasonable legal fees) incurred by any Svanty Party as a result of, or in connection with, any breach or alleged breach by the User or anyone acting on the User&rsquo;s behalf of any of the terms of this Agreement.</p>\r\n\r\n<p>9. PROCEDURE OF NOTIFICATION AND PRESENTATION OF INFRINGEMENT CLAIMS</p>\r\n\r\n<p>Svanty respects intellectual property laws and expects all users to follow the same principles. In the event the User believes his/her intellectual property has been copied and used in violation of his/her rights or User&rsquo;s intellectual property rights have been breached otherwise, he/she should submit a written communication to Svanty including the following information:</p>\r\n\r\n<ul>\r\n	<li>\r\n	<p>Physical or electronic signature of a person authorized to act on behalf of the owner of the copyright or other intellectual property in question;</p>\r\n	</li>\r\n	<li>\r\n	<p>Description of the work or other kind of intellectual property belonging to the owner that the User claims has been breached;</p>\r\n	</li>\r\n	<li>\r\n	<p>Description of the place at the Site where this material was placed;</p>\r\n	</li>\r\n	<li>\r\n	<p>The e-mail address, phone number and physical address of the User;</p>\r\n	</li>\r\n	<li>\r\n	<p>The User&rsquo;s application including a reasonable supposition that the disputed usage is not allowed by the law or copyright owner;</p>\r\n	</li>\r\n	<li>\r\n	<p>A statement corresponding to one made under oath that the information presented by the User is reliable and correct and that the statement author is a person who is authorized to act on behalf of the copyright owner or is the owner himself/herself.</p>\r\n	</li>\r\n</ul>\r\n\r\n<p>The letter including all of the above data should be addressed to the CEO of Svanty, Inc. and submitted through Contact us or by e-mail at support@svanty.com.</p>\r\n\r\n<p>10. APPLICABLE LAW</p>\r\n\r\n<p>The validity, interpretation and enforcement of this Terms of Use, matters arising out of or related to performance or breach of this Terms of Use, and related matters shall be governed by the internal laws of the Ukraine (without reference to choice of law doctrine). Any legal action or proceeding concerning the validity, interpretation and enforcement of this Terms of Use, matters arising out of or related to performance or breach of this Terms of Use, and related matters, shall be brought exclusively in the Ukraine courts located in the Kyiv. All parties consent to the exclusive jurisdiction of those courts, waiving any objection to the propriety or convenience of such venues.&nbsp;</p>\r\n\r\n<p>11. GENERAL PROVISIONS</p>\r\n\r\n<p>Svanty&rsquo; failure to insist upon or enforce strict performance of any provision of this agreement shall not be construed as a waiver of any provision or right. If any provision of the Terms of Use can not be fulfilled completely or partially at the territory of a certain country, and the parties are not able to come to an agreement, the parties agree to settle all such matters by judicial process. In this case the court may select the closest statutory provisions, according to which the provision of the Terms of Use can be fulfilled partially or in full.</p>\r\n\r\n<p>12. CONTACTS</p>\r\n\r\n<p>For any questions in connection with the provisions of this document, please contact Svanty using the contact information below.</p>\r\n\r\n<p>Contact information:</p>\r\n\r\n<p>E-mail: support@svanty.com.</p>\r\n\r\n<p>Or use this link Contact Us.</p>\r\n\r\n<p><strong>Svanty</strong></p>\r\n\r\n<p>13. ACKNOWLEDGEMENT</p>\r\n\r\n<p>IN ACCEPTING THIS AGREEMENT, THE USER ACKNOWLEDGES THAT THE USER HAS READ THIS AGREEMENT, UNDERSTANDS IT, AND HAD AN OPPORTUNITY TO SEEK INDEPENDENT LEGAL ADVICE PRIOR TO AGREEING TO IT. IN CONSIDERATION OF Svanty AGREEING TO PROVIDE THE CONTENT, USER AGREES TO BE BOUND BY THE TERMS AND CONDITIONS OF THIS AGREEMENT. USER FURTHER AGREES THAT THIS IS THE COMPLETE AND EXCLUSIVE STATEMENT OF THE AGREEMENT BETWEEN USER AND Svanty, WHICH SUPERSEDES ANY PROPOSAL OR PRIOR AGREEMENT, ORAL OR WRITTEN, AND ANY OTHER COMMUNICATION BETWEEN USER AND Svanty RELATING TO THE SUBJECT OF THIS AGREEMENT.</p>\r\n\r\n<p><strong>Disclaimer: </strong>The original, legally binding version of this document is written in English, and it is translated into other languages for the courtesy of our non-English-speaking users. If there are any discrepancies between the English version and a translated version, the English version supercedes the translated version.</p>','terms');
